                                    } 
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Titel"
                                    value={title} 
                                    onChange={e => {
                                        // setEmail(e.target.value)
                                        }
                                    } 
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Subtext"
                                    value={subtext} 
                                    onChange={e => {
                                        // setEmail(e.target.value)
                                        }
                                    } 
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Location"
                                    value={location} 
                                    onChange={e => {
                                        // setEmail(e.target.value)
                                        }
                                    } 
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Longitude"
                                    value={long} 
                                    onChange={e => {
                                        // setEmail(e.target.value)
                                        }
                                    } 
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Latitude"
                                    value={lat} 
                                    onChange={e => {
                                        // setEmail(e.target.value)
                                        }
                                    } 
                                />
                        </Grid>
                        <Grid item>
                            <Input name="myImage" type="file" />
                        </Grid>
                        <Grid item>
                            <Button variant="contained" type="submit">
                                speichern
                            </Button>
                        </Grid>
                    </Grid>   
            </Form>


            ) }

        </Formik>
    )


}
